import axios from 'axios'
import Produto from '../components/Produto/Produto'


export async function getProduto(){
    
    const response = await axios.get("http://localhost:8080/produto/all")

    const produtos = response.data.map( k => {
        return new Produto(k.nome,k.descricao,k.imagemUrl)
    })

    return produtos
}
